import styled from "styled-components";
import { withProps } from "../util";

const Form = (...props) => {
  return withProps(Container, props);
};
const Container = styled.form`
  display: flex;
  width: 100%;
  height: 100%;
  flex-direction: column;
`;

export default Form;
